import React from 'react'

export const Footer = () => {
  return (
    <div className='bg-white p-5'>
        <div className='flex'>
            <div className='w-[20%]'>
                <img src={process.env.PUBLIC_URL + '/logo.png'} alt='' className='w-[122px]' />
            </div>
            <div className='w-[80%]'></div>
        </div>
    </div>
  )
}
